export class User {
  constructor(
    username,
    password,
    u_name,
    u_nickname,
    u_email,
    u_tel,
    u_addr,
    u_level
  ) {
    this.username = username;
    this.password = password;
    this.u_name = u_name;
    this.u_nickname = u_nickname;
    this.u_email = u_email;
    this.u_tel = u_tel;
    this.u_addr = u_addr;
    this.u_level = u_level;
  }
}
